import React, { useEffect, useState } from 'react'

function Iphone11() {

    const [iphone11,setIphone11] = useState()

    const getAllIphone11 =async ()=>{
        try {
            const url = "http://localhost:5000/iphone/iphone11"
            const res = await fetch(url)
            const resJson = await res.json()

            setIphone11(resJson)
        } catch (error) {
            console.log(error)
        }

    }

    useEffect(()=>{
    getAllIphone11()
    },[])

  return (
    <div>
        <h1> Iphone11</h1>

        {
        iphone11.map((item, index)=>
    <div>
    <h2>{item.name}</h2>
    <p>{item.price}</p>
    </div>)
    }

    </div>
  )
}

export default Iphone11
